import React from 'react';
import './TopHeader.css';
// Import SVG icons
import fbIcon from '../../../assets/icons/fb-icon.svg';
import xIcon from '../../../assets/icons/x-icon.svg';
import instaIcon from '../../../assets/icons/insta-icon.svg';
import emailIcon from '../../../assets/icons/email-icon.svg';

const TopHeader = () => {
  return (
    <div className="top-header">
      <div className="social-icons">
        <a href="#" className="social-icon facebook">
          <img src={fbIcon} alt="Facebook" className="social-icon-img" />
        </a>
        <a href="#" className="social-icon twitter">
          <img src={xIcon} alt="X" className="social-icon-img" />
        </a>
        <a href="#" className="social-icon instagram">
          <img src={instaIcon} alt="Instagram" className="social-icon-img" />
        </a>
        <a href="#" className="social-icon email">
          <img src={emailIcon} alt="Email" className="social-icon-img" />
        </a>
      </div>
      <div className="announcement">
        <p>AVOID UP TO 25% PRICE INCREASES NEXT MONTH - SHOP PRE-TARIFF DRESSES TODAY!</p>
      </div>
      <div className="contact-info">
        <a href="tel:+18554458001">(855) 445-8001</a>
      </div>
    </div>
  );
};

export default TopHeader;
